def AvgAccLoss(arr):
    acc = list(np.zeros(100))
    loss = list(np.zeros(100))
    for i in range(len(arr)):
        if i % 2 == 0:
            for j in range(len(acc)):
                acc[j] += arr[i][j]
        else:
            for j in range(len(acc)):
                loss[j] += arr[i][j]

    for i in range(len(acc)):
        acc[i] /= (len(arr)/2)
        loss[i] /= (len(arr)/2)

    return acc, loss


